INSERT INTO `Announcements` VALUES ('cmk18d6j9000iqn0pcwcptwqx','? IMPORTANT NOTICE TO OUR VALUED CUSTOMERS','Please note that our working hours are 7:00am – 9:00pm, and on Sundays: 11:30am – 9:00pm.\nIf you see OUT OF STOCK, it may be outside our working hours. Kindly check back during these times.',1,1,'2026-01-05 14:02:54.933','2026-01-05 14:02:54.933','1','shop','all'),('cmk19yyzj000jqn0p2yzczlm9','SERIOUS NOTICE TO ALL AGENTS','This notice is issued due to some agents failing to read updates. Any agent who ignores official notices will be fully responsible for any losses. Please read all communications carefully.',1,1,'2026-01-05 14:47:51.199','2026-01-05 14:47:51.199','1','login','all'),('cmk3iwish0000pb0prmxqf73d','SERIOUS NOTICE TO ALL AGENTS','This notification has been issued due to repeated failure by some agents to carefully read updates. Please note that any agent who ignores official notices and incurs losses as a result will be fully responsible for such losses. Kindly read all communications thoroughly to avoid issues.',0,1,'2026-01-07 04:33:25.793','2026-01-07 06:57:20.075','1','login','other'),('cmk3o1l2f0001pb0pc8q5ccmc','Testing ','UPDATE FOR ALL AGENTS\n\nPlease note that the system update and upgrade will NOT take place tonight as earlier communicated.\n\nWe sincerely apologize for any inconvenience or confusion this may have caused. A new date and time will be communicated in due course.\n\nIn the meantime, agents are advised to continue keeping proper records of all orders and transactions.\n\nThank you for your patience, understanding, and continued cooperation.',1,1,'2026-01-07 06:57:20.103','2026-01-07 06:57:20.103','1','login','other'),('cmk3oel5p0002pb0pqk9rch9w',' TELECEL & AIRTELTIGO DATA','For Telecel and AirtelTigo data to deliver successfully, the customer must have an active regular data bundle on their line.\n\nMidnight bundles and the default 40KB data do not qualify. If no valid active bundle exists, the data will not reflect, regardless of how many times it is sent.\n\nIn cases where our system confirms that no active bundle was available at the time of purchase, we will not be liable for any loss.\n\nPlease ensure customers confirm their data status before purchasing.\n\nThank you for your cooperation.',1,1,'2026-01-07 07:07:26.750','2026-01-07 07:07:26.750','1','all','all'),('cmk3tjgu40003pb0pmzh9nkr4','NOTICE TO VALUED CUSTOMERS','Please be informed that our working hours are as follows:\n	•	Monday to Saturday: 7:00 AM – 9:00 PM\n	•	Sundays: 11:00 AM (or earlier) – 9:00 PM\n\nAny out-of-stock issue or service interruption outside these working hours should be considered as a network-related issue from MTN, not from our end.',1,1,'2026-01-07 09:31:12.508','2026-01-07 09:31:12.508','1','shop','shop');
